import React from 'react';
import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Head from '../components/head';
import Image1 from'../img/kimetsu.jpg';
import Image2 from'../img/zetsu2.png';
import Image3 from'../img/zetsu.png';
import Image4 from'../img/field.png';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel} from 'react-responsive-carousel';

function home(){
    return(
        <React.Fragment>
        <Head></Head>
    
        
        
        <div class="container bg-dark mb-5" style={{height: '85vh'}}>
        <img  class="img-fluid p-3" alt="Imagem responsiva" style={{height: '85vh', width:'100%' }} src={Image4}></img>
        <h1 style={{fontFamily:'Times New Roman'}} class="text-lg-center">Maior Forum de Criação de Jogos do Brasil</h1>
        </div>
        <div class ="container bg-dark" style={{height: '85vh'}}>
            <h1 class="text-success">Hello world !!!</h1>
        </div>
        
        <footer>
            <div class="bg-dark text-warning pt-3" style={{height:'75px', textAlign:'center'}}>
                <span>© 2021 Copyright: Wallace</span>
            </div>
        </footer>
        </React.Fragment>
    )
}

export default home;
